import React from "react";
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import '../assets/styles/Main.scss';

function Main() {

  return (
    <div className="container">
      <div className="about-section">
        {/* <div className="image-wrapper">
          <img src="https://my-aws-assets.s3.us-west-2.amazonaws.com/portfolio-img/avatar_circle.jpeg" alt="Avatar" />
        </div> */}

        <div className="content">

          <h1>Hi, I'm Moira!</h1>
          <p>
            3rd IT student studying at Nanyang Polytechnic, 
            where I've had the opportunity to explore web and app development, 
            as well as dive into security fundamentals.
          </p>

          <div className="social_icons">
            <a href="https://github.com/immooster" target="_blank" rel="noreferrer"><GitHubIcon/></a>
            <a href="https://www.linkedin.com/in/moira-cabuhat-31b08b2b2/" target="_blank" rel="noreferrer"><LinkedInIcon/></a>
          </div>

          <div className="mobile_social_icons">
            <a href="https://github.com/immooster" target="_blank" rel="noreferrer"><GitHubIcon/></a>
            <a href="https://www.linkedin.com/in/moira-cabuhat-31b08b2b2/" target="_blank" rel="noreferrer"><LinkedInIcon/></a>
          </div>

        </div>
      </div>
    </div>
  );
}

export default Main;
